import {MDBContainer} from "mdbreact";
import React from "react";
import {Bar, Doughnut} from "react-chartjs-2";

export type ChartProps = {
    BarChartData?:any;
    barChartOptions?:any;
    donutchartdata?: any;
    data?:any;
    graphData?:any;

}

const Charts=(props:ChartProps)=> {


if(props?.data === "barchart"){


  return (

  <MDBContainer>
     <Bar data={props?.data} options={props?.barChartOptions} height={props?.BarChartData?.height} />
   </MDBContainer>

 )
}
else if (props?.data === "donutchart"){
  return (


     <MDBContainer>
          <Doughnut
          data={props?.data}
          options={{responsive: true}}
          height={props?.donutchartdata?.height}
        />


     </MDBContainer>
 )

}


}

export default Charts;
